-- *** CREATE DATABASE NAME: fittruk

--==========-- Presentation Data --============-- Presentation Data --============-- Presentation Data --============--
--==========-- Presentation Data --============-- Presentation Data --============-- Presentation Data --============--
CREATE TABLE "user" (
	"id" SERIAL PRIMARY KEY NOT NULL,
	"username" VARCHAR (80) UNIQUE NOT NULL,
  "password" VARCHAR (1000),
	"first_name" VARCHAR(255),
	"last_name" VARCHAR(255),
	"email" VARCHAR(255),
	"phone_number" VARCHAR (20),
	"street" VARCHAR(255),
	"city" VARCHAR (50),
	"state" VARCHAR (50),
	"zip" VARCHAR (20),
	"dob" DATE,
	"pronouns" VARCHAR(255),
	"emergency_name" VARCHAR(255),
	"emergency_number" VARCHAR(20),
	"profile_image" VARCHAR(255),
	"free_classes" VARCHAR DEFAULT 3,
	"access_level" INTEGER DEFAULT 1
);

CREATE TABLE "classes" (
	"id" SERIAL PRIMARY KEY NOT NULL,
	"classname" VARCHAR(255),
	"description" VARCHAR(500),
	"trainer_user_id" INT REFERENCES "user",
	"date" DATE,
	"start_time" TIME,
	"end_time" TIME,
	"street" VARCHAR (255),
	"city" VARCHAR (50),
	"state" VARCHAR (50),
	"zip" VARCHAR (20),
	"class_size" INTEGER
);


CREATE TABLE "class_list" (
	"id" SERIAL PRIMARY KEY NOT NULL,
	"class_id" INT REFERENCES "classes" ON DELETE CASCADE ON UPDATE CASCADE,
	"user_id" INT REFERENCES "user",
	"checked_in" BOOLEAN DEFAULT FALSE
);













